import React from 'react';
import Button from "react-bootstrap/Button";
import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";
import NavbarBrand from "react-bootstrap/NavbarBrand";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faSignOutAlt } from '@fortawesome/free-solid-svg-icons'
import { faBoxOpen } from '@fortawesome/free-solid-svg-icons'
import { faCoins } from '@fortawesome/free-solid-svg-icons'

import styled from "styled-components";

import logo from "../images/pokepacksonline.png"

export default class NavbarComponent extends React.Component{
    render() {

        const Styles = styled.div`
            #.custom-nav-link{
                color: #FFFFFF;
            }
        `

        const Logo = styled.img`
            height: auto;
            width: 30%;
        `
        //<Logo className="float-left" src={logo}>
        //<NavbarBrand style={{color: "#FFFFFF", fontSize: "2rem",}}></NavbarBrand>
        return (
            <Styles>
                <Navbar style={{backgroundColor: "#121212"}}>
                    <Logo src={logo}></Logo>

                    <Nav className="ml-auto">
                        <Nav.Link bsClass="custom-nav-link" style={{color: "#FFFFFF"}} href="#"><FontAwesomeIcon icon={faBoxOpen}/> Open Packs</Nav.Link>
                        <Nav.Link  href="#"><FontAwesomeIcon icon={faCoins}/> Shop</Nav.Link>
                        <Nav.Link style={{color: "#FFFFFF"}} href="#"><FontAwesomeIcon icon={faSignOutAlt}/> Sign Out</Nav.Link>
                    </Nav>
                </Navbar>
            </Styles>
            
        );
    }
}
